import React, { useState } from "react";

import Header from "./Header.js"

// import {Links} from "./ProjectData"
import {Videos} from "./ProjectData"

import currrentLinks from "./currrentLinks.js"

import Video from "./Video.js"
import Embed from "./Embed.js"



export default function Eat() {

  // const [currentCat, setCurrentCat] = useState("eat")

  // const currrentLinks = Links.filter((newProject) => {
  //   return newProject.category === currentCat;
  // });

  return (

    <div>
      <Header type = {"UX/UI Design"} title = {"eat!"} desc = {"desc"} src = {"./content/Content-eat/eatCover.jpg"}/>
      <div className = "page-content">
        <div className = "content-flex">
        {Videos.map(p => (
            <Video {...p} />
            ))
        }
        {/* <Embed name = "Final Presentation" src = "https://docs.google.com/presentation/d/e/2PACX-1vTIfbml5J4i7N8ZgOMbjy3Je5S11Ke3t_qPFx_FgYze8jEIkk5TTJXMRMUYNOf692er6Daj4NljeF8X/embed?start=false&loop=false&delayms=3000" /> */}
        </div>

        {/* how can i make flex box with still having it pull from array */
        /* how I can style the embed */}

        {/* {currrentLinks.map(p => (
            <Embed {...p} />
            ))
        } */}

        <currrentLinks />

      </div>
    </div>

  );
}
